    aboutIntro: "\u092E\u0941\u091D\u0947 \u0906\u0936\u093E \u0939\u0948 \u0915\u093F \u0939\u092E \u0938\u092D\u0940 \u0907\u0902\u091F\u0930\u0928\u0947\u091F \u092A\u0930 \u0935\u093F\u0936\u093E\u0932 \u0935\u093F\u0926\u0947\u0936\u0940 \u092D\u093E\u0937\u093E \u0915\u0940 \u091C\u093E\u0928\u0915\u093E\u0930\u0940 \u0905\u0927\u093F\u0915 \u0906\u0938\u093E\u0928\u0940 \u0938\u0947 \u0914\u0930 \u0916\u0941\u0936\u0940 \u0938\u0947 \u092A\u094D\u0930\u093E\u092A\u094D\u0924 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u2764\uFE0F \u0906\u092A <6> \u092A\u094D\u0930\u094B \u0938\u0926\u0938\u094D\u092F\u0924\u093E \u0916\u094B\u0932\u0928\u093E \u091A\u0941\u0928 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902</6> \u0921\u0940\u092A\u090F\u0932 \u0914\u0930 \u0913\u092A\u0928\u090F\u0906\u0908 \u0905\u0928\u0941\u0935\u093E\u0926\u094B\u0902 \u0915\u094B \u092C\u0949\u0915\u094D\u0938 \u0938\u0947 \u092C\u093E\u0939\u0930 \u0909\u092A\u092F\u094B\u0917 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F\u0964 <br/><br/>\u0939\u092E\u0947\u0902 <3>\u091F\u094D\u0935\u093F\u091F\u0930 \u092A\u0930 \u092B\u093C\u0949\u0932\u094B \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902</3> ,<4>\u091F\u0947\u0932\u0940\u0917\u094D\u0930\u093E\u092E \u091A\u0948\u0928\u0932</4> , WeChat \u0938\u093E\u0930\u094D\u0935\u091C\u0928\u093F\u0915 \u0916\u093E\u0924\u093E, WeChat \u0938\u0902\u091A\u093E\u0930 \u0938\u092E\u0942\u0939, \u092F\u093E \u0928\u0940\u091A\u0947 <5> \u0908\u092E\u0947\u0932 \u0938\u0926\u0938\u094D\u092F\u0924\u093E</5> \u0905\u092A\u0921\u0947\u091F \u091F\u094D\u0930\u0948\u0915 \u0915\u0930\u0947\u0902.<br/> <7>\u092A\u094D\u0930\u094B \u0938\u0926\u0938\u094D\u092F</7> \u0906\u092A \u090F\u0915\u094D\u0938\u092A\u094D\u0930\u0947\u0938 \u0917\u094D\u0930\u093E\u0939\u0915 \u0938\u0947\u0935\u093E \u0908\u092E\u0947\u0932 <8> support@immersivetranslate.com \u0938\u0947 \u0938\u0902\u092A\u0930\u094D\u0915 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902</8> \u0939\u092E\u093E\u0930\u0947 \u0938\u093E\u0925 \u091C\u0941\u0921\u093C\u0947\u0964",
    aboutIntroWithoutSponsor: "\u092E\u0941\u091D\u0947 \u0906\u0936\u093E \u0939\u0948 \u0915\u093F \u0939\u092E \u0938\u092D\u0940 \u0907\u0902\u091F\u0930\u0928\u0947\u091F \u092A\u0930 \u0935\u093F\u0936\u093E\u0932 \u092E\u093E\u0924\u094D\u0930\u093E \u092E\u0947\u0902 \u0935\u093F\u0926\u0947\u0936\u0940 \u092D\u093E\u0937\u093E \u0915\u0940 \u091C\u093E\u0928\u0915\u093E\u0930\u0940 \u0924\u0915 \u0906\u0938\u093E\u0928 \u0914\u0930 \u0905\u0927\u093F\u0915 \u0906\u0928\u0902\u0926\u0926\u093E\u092F\u0915 \u092A\u0939\u0941\u0902\u091A \u092A\u094D\u0930\u093E\u092A\u094D\u0924 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u2764\uFE0F  <br/><br/>\u0906\u092A \u0939\u092E\u0947\u0902 \u091F\u094D\u0935\u093F\u091F\u0930 \u092A\u0930 \u092B\u093C\u0949\u0932\u094B \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 <3></3> ,<4>\u091F\u0947\u0932\u0940\u0917\u094D\u0930\u093E\u092E \u091A\u0948\u0928\u0932</4> , WeChat \u0938\u093E\u0930\u094D\u0935\u091C\u0928\u093F\u0915 \u0916\u093E\u0924\u093E, WeChat \u0938\u0902\u091A\u093E\u0930 \u0938\u092E\u0942\u0939, \u092F\u093E \u0928\u0940\u091A\u0947 <5> \u0908\u092E\u0947\u0932 \u0938\u0926\u0938\u094D\u092F\u0924\u093E</5> \u0905\u092A\u0921\u0947\u091F \u091F\u094D\u0930\u0948\u0915 \u0915\u0930\u0947\u0902.",
