    enableSearchEnhancementDescription: '\u091A\u093E\u0932\u0942 \u0939\u094B\u0928\u0947 \u0915\u0947 \u092C\u093E\u0926, \u0905\u0902\u0917\u094D\u0930\u0947\u091C\u0940 \u0915\u0940\u0935\u0930\u094D\u0921 \u0938\u0947 \u0938\u0902\u092C\u0902\u0927\u093F\u0924 "Google \u0938\u092E\u093E\u091A\u093E\u0930" \u0916\u094B\u091C \u092A\u0930\u093F\u0923\u093E\u092E \u0938\u094D\u0935\u091A\u093E\u0932\u093F\u0924 \u0930\u0942\u092A \u0938\u0947 \u0938\u092E\u0930\u094D\u0925\u093F\u0924 \u0935\u0947\u092C\u0938\u093E\u0907\u091F\u094B\u0902 (Google \u0938\u092E\u093E\u091A\u093E\u0930, Google \u0916\u094B\u091C (\u0915\u0941\u091B \u0915\u0940\u0935\u0930\u094D\u0921), \u0938\u094D\u0928\u094B\u092C\u0949\u0932, \u0913\u0930\u093F\u090F\u0902\u091F\u0932 \u092B\u0949\u0930\u094D\u091A\u094D\u092F\u0942\u0928, \u092B\u093C\u0941\u091F\u0942, \u091F\u093E\u0907\u0917\u0930 \u0938\u092E\u0941\u0926\u093E\u092F) \u0915\u0947 \u0926\u093E\u0939\u093F\u0928\u0947 \u0915\u0949\u0932\u092E \u092E\u0947\u0902 \u092A\u094D\u0930\u0926\u0930\u094D\u0936\u093F\u0924 \u0939\u094B\u0902\u0917\u0947\u0964',
