    "field.placeholderDelimiters": "\u0906\u0930\u0915\u094D\u0937\u093F\u0924 \u092A\u094D\u0932\u0947\u0938\u0939\u094B\u0932\u094D\u0921\u0930",
    "description.custom": "<a href='https://immersivetranslate.com/docs/services/custom/' target='_blank'>\u0915\u0938\u094D\u091F\u092E \u0907\u0902\u091F\u0930\u092B\u093C\u0947\u0938 \u090F\u0915\u094D\u0938\u0947\u0938</a> \u0915\u0947 \u0932\u093F\u090F \u0938\u0902\u0926\u0930\u094D\u092D \u0926\u0938\u094D\u0924\u093E\u0935\u0947\u091C\u093C\u094B\u0902 \u0915\u0940 \u0906\u0935\u0936\u094D\u092F\u0915\u0924\u093E \u0939\u0948",
    "description.limitPerMinute": "\u091C\u092C \u0905\u0928\u0941\u0930\u094B\u0927\u094B\u0902 \u0915\u0940 \u0938\u0902\u0916\u094D\u092F\u093E \u0907\u0938 \u0938\u0940\u092E\u093E \u0938\u0947 \u0905\u0927\u093F\u0915 \u0939\u094B \u091C\u093E\u0924\u0940 \u0939\u0948, \u0924\u094B \u092F\u0939 \u0905\u0917\u0932\u0947 \u092E\u093F\u0928\u091F \u0915\u0940 \u0936\u0941\u0930\u0941\u0906\u0924 \u0924\u0915 \u0915\u0924\u093E\u0930 \u0938\u094D\u0925\u093F\u0924\u093F \u092E\u0947\u0902 \u092A\u094D\u0930\u0935\u0947\u0936 \u0915\u0930\u0947\u0917\u0940\u0964 OpenAI \u0915\u0940 \u0935\u0930\u094D\u0924\u092E\u093E\u0928 \u0938\u0947\u0935\u093E \u0915\u0940 \u0935\u093F\u092D\u093F\u0928\u094D\u0928 \u0938\u0940\u092E\u093E\u0913\u0902 \u0915\u0947 \u0915\u093E\u0930\u0923, \u0915\u0943\u092A\u092F\u093E \u092F\u0939\u093E\u0902 <1> \u0915\u094D\u0932\u093F\u0915 \u0915\u0930\u0947\u0902</1> \u0928\u0935\u0940\u0928\u0924\u092E \u0905\u0928\u0941\u0936\u0902\u0938\u093F\u0924 \u092E\u093E\u0928 \u0926\u0947\u0916\u0947\u0902",
    "description.limitPerSecond": "\u091C\u092C \u0905\u0928\u0941\u0930\u094B\u0927\u094B\u0902 \u0915\u0940 \u0938\u0902\u0916\u094D\u092F\u093E \u0907\u0938 \u0938\u0940\u092E\u093E \u0938\u0947 \u0905\u0927\u093F\u0915 \u0939\u094B \u091C\u093E\u0924\u0940 \u0939\u0948, \u0924\u094B \u092F\u0939 \u0905\u0917\u0932\u0947 \u0938\u0947\u0915\u0902\u0921 \u0915\u0940 \u0936\u0941\u0930\u0941\u0906\u0924 \u0924\u0915 \u0915\u0924\u093E\u0930 \u0938\u094D\u0925\u093F\u0924\u093F \u092E\u0947\u0902 \u092A\u094D\u0930\u0935\u0947\u0936 \u0915\u0930\u0947\u0917\u0940\u0964 OpenAI \u0915\u0940 \u0935\u0930\u094D\u0924\u092E\u093E\u0928 \u0938\u0947\u0935\u093E \u0915\u0940 \u0935\u093F\u092D\u093F\u0928\u094D\u0928 \u0938\u0940\u092E\u093E\u0913\u0902 \u0915\u0947 \u0915\u093E\u0930\u0923, \u0915\u0943\u092A\u092F\u093E \u092F\u0939\u093E\u0902 <1> \u0915\u094D\u0932\u093F\u0915 \u0915\u0930\u0947\u0902</1> \u0928\u0935\u0940\u0928\u0924\u092E \u0905\u0928\u0941\u0936\u0902\u0938\u093F\u0924 \u092E\u093E\u0928 \u0926\u0947\u0916\u0947\u0902",
    "description.generalLimitPerSecond": "\u091C\u092C \u0905\u0928\u0941\u0930\u094B\u0927\u094B\u0902 \u0915\u0940 \u0938\u0902\u0916\u094D\u092F\u093E \u0907\u0938 \u0938\u0940\u092E\u093E \u0938\u0947 \u0905\u0927\u093F\u0915 \u0939\u094B \u091C\u093E\u0924\u0940 \u0939\u0948, \u0924\u094B \u092F\u0939 \u0905\u0917\u0932\u0947 \u0938\u0947\u0915\u0902\u0921 \u0915\u0940 \u0936\u0941\u0930\u0941\u0906\u0924 \u0924\u0915 \u0915\u0924\u093E\u0930 \u0938\u094D\u0925\u093F\u0924\u093F \u092E\u0947\u0902 \u092A\u094D\u0930\u0935\u0947\u0936 \u0915\u0930\u0947\u0917\u0940\u0964",
    "description.prompt": "\u0909\u092A\u092F\u094B\u0917\u0915\u0930\u094D\u0924\u093E \u0915\u0940 \u092A\u0939\u091A\u093E\u0928 \u092E\u0947\u0902 {service} \u0915\u094B \u092D\u0947\u091C\u0940 \u0917\u0908 \u0935\u093E\u0930\u094D\u0924\u093E\u0932\u093E\u092A, \u091C\u093F\u0938\u092E\u0947\u0902 {{text}} \u092A\u0948\u0930\u093E\u0917\u094D\u0930\u093E\u092B \u0915\u093E \u092A\u093E\u0920 \u0938\u093E\u092E\u0917\u094D\u0930\u0940 \u0915\u094B \u0926\u0930\u094D\u0936\u093E\u0924\u093E \u0939\u0948, {{from}} \u092A\u0948\u0930\u093E\u0917\u094D\u0930\u093E\u092B \u0915\u0940 \u092D\u093E\u0937\u093E \u0915\u094B \u0926\u0930\u094D\u0936\u093E\u0924\u093E \u0939\u0948, \u0914\u0930 {{to}} \u0932\u0915\u094D\u0937\u094D\u092F \u092D\u093E\u0937\u093E \u0915\u094B \u0926\u0930\u094D\u0936\u093E\u0924\u093E \u0939\u0948\u0964",
    "description.maxTextLengthPerRequest": "\u092A\u094D\u0930\u0924\u093F \u0905\u0928\u0941\u0930\u094B\u0927 \u0935\u0930\u094D\u0923\u094B\u0902 \u0915\u0940 \u0905\u0927\u093F\u0915\u0924\u092E \u0938\u0902\u0916\u094D\u092F\u093E\u0964 \u092F\u0926\u093F \u092F\u0939 \u092C\u0939\u0941\u0924 \u092C\u0921\u093C\u093E \u0939\u0948, \u0924\u094B \u0907\u0902\u091F\u0930\u092B\u093C\u0947\u0938 \u0915\u0940 \u092A\u094D\u0930\u0924\u093F\u0915\u094D\u0930\u093F\u092F\u093E \u0927\u0940\u092E\u0940 \u0939\u094B \u091C\u093E\u090F\u0917\u0940, \u0907\u0938\u0932\u093F\u090F \u0906\u092A \u0917\u0924\u093F \u0915\u094B \u0905\u0928\u0941\u0915\u0942\u0932\u093F\u0924 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F \u0907\u0938 \u0935\u093F\u0915\u0932\u094D\u092A \u0915\u094B \u0938\u092E\u093E\u092F\u094B\u091C\u093F\u0924 \u0915\u0930\u0928\u0947 \u0915\u093E \u092A\u094D\u0930\u092F\u093E\u0938 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964",
    "description.systemPrompt": "\u0938\u093F\u0938\u094D\u091F\u092E \u0915\u0940 \u092A\u0939\u091A\u093E\u0928 \u0938\u0947 {service} \u0915\u094B \u092D\u0947\u091C\u0940 \u0917\u0908 \u0935\u093E\u0930\u094D\u0924\u093E\u0932\u093E\u092A, \u091C\u093F\u0938\u092E\u0947\u0902 {{text}} \u092A\u0948\u0930\u093E\u0917\u094D\u0930\u093E\u092B \u0915\u0947 \u092A\u093E\u0920 \u0915\u0940 \u0938\u093E\u092E\u0917\u094D\u0930\u0940 \u0915\u094B \u0926\u0930\u094D\u0936\u093E\u0924\u093E \u0939\u0948, {{from}} \u092A\u0948\u0930\u093E\u0917\u094D\u0930\u093E\u092B \u0915\u0940 \u092D\u093E\u0937\u093E \u0915\u094B \u0926\u0930\u094D\u0936\u093E\u0924\u093E \u0939\u0948, {{to}} \u0932\u0915\u094D\u0937\u094D\u092F \u092D\u093E\u0937\u093E \u0915\u094B \u0926\u0930\u094D\u0936\u093E\u0924\u093E \u0939\u0948",
    "field.domain": "\u092E\u0948\u0926\u093E\u0928",
    "description.domain": "\u0921\u093F\u092B\u093C\u0949\u0932\u094D\u091F\uFF1A\u0938\u093E\u092E\u093E\u0928\u094D\u092F \u0939\u0948. \u0907\u0938\u0947 \u0915\u0947\u0935\u0932 \u0924\u092D\u0940 \u0938\u0947\u091F \u0915\u093F\u092F\u093E \u091C\u093E \u0938\u0915\u0924\u093E \u0939\u0948 \u091C\u092C Youdao API \u0915\u0902\u0938\u094B\u0932 \u092E\u0947\u0902 \u0921\u094B\u092E\u0947\u0928-\u0906\u0927\u093E\u0930\u093F\u0924 \u0905\u0928\u0941\u0935\u093E\u0926 \u0938\u0915\u094D\u0937\u092E \u0939\u094B\u0964 \u0938\u092E\u0930\u094D\u0925\u093F\u0924 \u092B\u093C\u0940\u0932\u094D\u0921 \u0915\u0947 \u0932\u093F\u090F, \u0915\u0943\u092A\u092F\u093E \u092F\u0939\u093E\u0902 <1> \u0926\u0947\u0916\u0947\u0902\u0964</1>",
    "field.scene": "\u092A\u0930\u094D\u0926\u0947",
