    "field.vocabId": "\u0909\u092A\u092F\u094B\u0917\u0915\u0930\u094D\u0924\u093E \u0936\u092C\u094D\u0926\u0915\u094B\u0936 \u0906\u0908\u0921\u0940",
    "description.vocabId": "\u0928\u093F\u0930\u094D\u0926\u093F\u0937\u094D\u091F \u0936\u092C\u094D\u0926\u0915\u094B\u0936 \u0906\u0909\u091F_\u0906\u0908\u0921\u0940 \u0935\u0930\u094D\u0924\u092E\u093E\u0928 \u092E\u0947\u0902 \u0905\u0902\u0917\u094D\u0930\u0947\u091C\u0940-\u091A\u0940\u0928\u0940 \u0905\u0928\u0941\u0935\u093E\u0926 \u0915\u093E \u0938\u092E\u0930\u094D\u0925\u0928 \u0915\u0930\u0924\u093E \u0939\u0948\u0964",
