    reloadCurrentPage: "\u0915\u0943\u092A\u092F\u093E \u0905\u0928\u0941\u0935\u093E\u0926 \u0936\u0941\u0930\u0942 \u0915\u0930\u0928\u0947 \u0938\u0947 \u092A\u0939\u0932\u0947 \u0935\u0930\u094D\u0924\u092E\u093E\u0928 \u092A\u0943\u0937\u094D\u0920 \u0915\u094B \u0924\u093E\u091C\u093C\u093E \u0915\u0930\u0947\u0902",
