    "subtitle.disabledSubtitleDescription": "\u092F\u0926\u093F \u0907\u092E\u0930\u094D\u0938\u093F\u0935 \u091F\u094D\u0930\u093E\u0902\u0938\u0932\u0947\u0936\u0928 \u0915\u0947 \u0935\u0940\u0921\u093F\u092F\u094B \u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0905\u0928\u094D\u092F \u090F\u0915\u094D\u0938\u091F\u0947\u0902\u0936\u0928 \u0915\u0947 \u0938\u093E\u0925 \u0938\u0902\u0918\u0930\u094D\u0937 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u0924\u094B \u0906\u092A \u0907\u092E\u0930\u094D\u0938\u093F\u0935 \u091F\u094D\u0930\u093E\u0902\u0938\u0932\u0947\u0936\u0928 \u0915\u0947 \u0935\u0940\u0921\u093F\u092F\u094B \u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u092B\u093C\u0902\u0915\u094D\u0936\u0928 \u0915\u094B \u0938\u094D\u0925\u093E\u092F\u0940 \u0930\u0942\u092A \u0938\u0947 \u0905\u0915\u094D\u0937\u092E \u0915\u0930\u0928\u093E \u092F\u093E \u0905\u0928\u094D\u092F \u0935\u093F\u0930\u094B\u0927\u093E\u092D\u093E\u0938\u0940 \u090F\u0915\u094D\u0938\u091F\u0947\u0902\u0936\u0928 \u0915\u094B \u0905\u0928\u0907\u0902\u0938\u094D\u091F\u0949\u0932 \u0915\u0930\u0928\u093E \u091A\u0941\u0928 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964",
    "subtitle.autoEnableSubtitle": "\u0938\u094D\u0935\u091A\u093E\u0932\u093F\u0924 \u0930\u0942\u092A \u0938\u0947 \u0926\u094D\u0935\u093F\u092D\u093E\u0937\u0940 \u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0915\u093E \u0909\u092A\u092F\u094B\u0917 \u0915\u0930\u0947\u0902",
    "subtitle.autoEnableSubtitleDescription": "\u0938\u0915\u094D\u0930\u093F\u092F \u0915\u0930\u0928\u0947 \u0915\u0947 \u092C\u093E\u0926, \u091C\u092C \u0935\u0940\u0921\u093F\u092F\u094B \u091A\u0932 \u0930\u0939\u093E \u0939\u094B\u0924\u093E \u0939\u0948, \u0924\u094B \u0938\u094D\u0935\u091A\u093E\u0932\u093F\u0924 \u0930\u0942\u092A \u0938\u0947 \u0926\u094D\u0935\u093F\u092D\u093E\u0937\u0940\u092F \u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0926\u093F\u0916\u093E\u0908 \u0926\u0947\u0902\u0917\u0947, \u0905\u0928\u094D\u092F\u0925\u093E \u0905\u0928\u0941\u0935\u093E\u0926 \u092C\u091F\u0928 \u092A\u0930 \u0915\u094D\u0932\u093F\u0915 \u0915\u0930\u0928\u0947 \u0915\u0940 \u0906\u0935\u0936\u094D\u092F\u0915\u0924\u093E \u0939\u094B\u0917\u0940\u0964",
    "subtitle.preTranslation": "\u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0915\u093E \u0905\u0928\u0941\u0935\u093E\u0926 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F \u0907\u092E\u0930\u094D\u0938\u093F\u0935 \u091F\u094D\u0930\u093E\u0902\u0938\u0932\u0947\u0936\u0928 \u0915\u093E \u0909\u092A\u092F\u094B\u0917 \u0915\u0930\u0947\u0902",
    "subtitle.preTranslationDescription": "\u0907\u0938\u0947 \u0938\u0915\u094D\u0937\u092E \u0915\u0930\u0928\u0947 \u0915\u0947 \u092C\u093E\u0926, \u0928\u0940\u091A\u0947 \u0926\u0940 \u0917\u0908 \u0928\u093F\u0930\u094D\u0926\u093F\u0937\u094D\u091F \u0905\u0928\u0941\u0935\u093E\u0926 \u0938\u0947\u0935\u093E \u0915\u093E \u0909\u092A\u092F\u094B\u0917 \u0938\u0902\u092A\u0942\u0930\u094D\u0923 \u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0915\u093E \u0905\u0917\u094D\u0930\u093F\u092E \u0905\u0928\u0941\u0935\u093E\u0926 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F \u0915\u093F\u092F\u093E \u091C\u093E\u090F\u0917\u093E\u0964 \u090F\u0915 \u0918\u0902\u091F\u0947 \u0915\u093E \u0935\u0940\u0921\u093F\u092F\u094B \u0932\u0917\u092D\u0917 50,000 \u091F\u094B\u0915\u0928 \u092F\u093E \u0935\u0930\u094D\u0923\u094B\u0902 \u0915\u093E \u0909\u092A\u092D\u094B\u0917 \u0915\u0930\u0924\u093E \u0939\u0948, \u0907\u0938\u0932\u093F\u090F \u0915\u0943\u092A\u092F\u093E \u0907\u0938\u0947 \u0909\u092A\u092F\u0941\u0915\u094D\u0924 \u0915\u0947 \u0930\u0942\u092A \u092E\u0947\u0902 \u0909\u092A\u092F\u094B\u0917 \u0915\u0930\u0947\u0902; \u0907\u0938\u0947 \u092C\u0902\u0926 \u0915\u0930\u0928\u0947 \u0915\u0947 \u092C\u093E\u0926, \u092E\u0936\u0940\u0928 \u0938\u0947 \u0905\u0928\u0941\u0935\u093E\u0926 \u0915\u093F\u092F\u093E \u091C\u093E\u090F\u0917\u093E \u092E\u0942\u0932 \u0935\u0940\u0921\u093F\u092F\u094B \u0915\u0947 \u0938\u093E\u0925 \u0906\u0928\u0947 \u0935\u093E\u0932\u0947 \u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0915\u093E \u092A\u0939\u0932\u0947 \u0909\u092A\u092F\u094B\u0917 \u0915\u093F\u092F\u093E \u091C\u093E\u090F\u0917\u093E\u0964",
    "subtitle.humanSubtitlesPreferred": "\u092E\u093E\u0928\u0935 \u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0915\u0947 \u0909\u092A\u092F\u094B\u0917 \u0915\u094B \u092A\u094D\u0930\u093E\u0925\u092E\u093F\u0915\u0924\u093E \u0926\u0947\u0902",
    "subtitle.humanSubtitlesPreferredDescription": "\u091C\u092C \u0915\u093F\u0938\u0940 \u0935\u0940\u0921\u093F\u092F\u094B \u092E\u0947\u0902 \u0932\u0915\u094D\u0937\u093F\u0924 \u092D\u093E\u0937\u093E \u092E\u0947\u0902 \u092E\u0948\u0928\u094D\u092F\u0941\u0905\u0932 \u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0939\u094B\u0902, \u0924\u094B \u092A\u0939\u0932\u0947 \u092E\u0948\u0928\u094D\u092F\u0941\u0905\u0932 \u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0915\u093E \u0909\u092A\u092F\u094B\u0917 \u0915\u0930\u0947\u0902 (\u0905\u0928\u0941\u0936\u0902\u0938\u093F\u0924)",
    videoSubtitleTranslationDescription: "\u0935\u0940\u0921\u093F\u092F\u094B \u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0915\u0947 \u0932\u093F\u090F \u090F\u0915 \u0905\u0932\u0917 \u0905\u0928\u0941\u0935\u093E\u0926 \u0938\u0947\u0935\u093E \u0928\u093E\u092E\u093F\u0924 \u0915\u0930\u0947\u0902",
    subtitleTranslating: "{service} \u0938\u0947\u0935\u093E \u0915\u093E \u0909\u092A\u092F\u094B\u0917 \u0915\u0930\u0915\u0947 \u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0915\u093E \u0905\u0928\u0941\u0935\u093E\u0926 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902, \u0915\u0943\u092A\u092F\u093E \u092A\u094D\u0930\u0924\u0940\u0915\u094D\u0937\u093E \u0915\u0930\u0947\u0902... (\u0907\u092E\u0930\u094D\u0938\u093F\u0935 \u0905\u0928\u0941\u0935\u093E\u0926)",
    subtitleLoading: "\u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0932\u094B\u0921 \u0939\u094B \u0930\u0939\u093E \u0939\u0948...",
    bilingual: "\u0926\u094D\u0935\u093F\u092D\u093E\u0937\u093F\u0915",
    "field.action": "Baidu \u0936\u092C\u094D\u0926\u093E\u0935\u0932\u0940 \u0915\u094B \u0938\u0915\u094D\u0937\u092E \u0915\u0930\u0928\u093E \u0939\u0948 \u092F\u093E \u0928\u0939\u0940\u0902",
    "description.action": "\u0938\u0915\u094D\u0937\u092E \u0915\u0930\u0928\u0947 \u0915\u0947 \u092C\u093E\u0926, \u0936\u092C\u094D\u0926 \u0915\u094B \u0938\u0915\u094D\u0937\u092E \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F Baidu \u0915\u094B \u0938\u0942\u091A\u093F\u0924 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0905\u0928\u0941\u0930\u094B\u0927 \u092E\u0947\u0902 \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u090F\u0915\u094D\u0936\u0928 = 1 \u091C\u094B\u0921\u093C\u093E \u091C\u093E\u090F\u0917\u093E\u0964 <1> \u0915\u0943\u092A\u092F\u093E \u0905\u0927\u093F\u0915 \u0928\u093F\u0930\u094D\u0926\u0947\u0936\u094B\u0902 \u0915\u0947 \u0932\u093F\u090F \u0906\u0927\u093F\u0915\u093E\u0930\u093F\u0915 \u0926\u0938\u094D\u0924\u093E\u0935\u0947\u091C\u093C \u0926\u0947\u0916\u0947\u0902\u0964</1>",
    closeQuickTranslation: "\u0924\u0948\u0930\u0924\u0940 \u0939\u0941\u0908 \u0917\u0947\u0902\u0926 \u0915\u094B \u092C\u0902\u0926 \u0915\u0930\u0947\u0902",
    "closeQuickTranslation.untilNext": "\u0905\u0917\u0932\u0940 \u092F\u093E\u0924\u094D\u0930\u093E \u0924\u0915 \u092C\u0902\u0926",
    "closeQuickTranslation.currentWebsite": "\u0935\u0930\u094D\u0924\u092E\u093E\u0928 \u0935\u0947\u092C\u0938\u093E\u0907\u091F \u0905\u0915\u094D\u0937\u092E \u0939\u0948",
    "closeQuickTranslation.alwaysClose": "\u0938\u094D\u0925\u093E\u092F\u0940 \u0930\u0942\u092A \u0938\u0947 \u0905\u0915\u094D\u0937\u092E",
    "closeQuickTranslation.settingOpen": "(<1> \u0938\u0947\u091F\u093F\u0902\u0917 \u092A\u0947\u091C \u092A\u0930 \u092A\u093E\u092F\u093E \u091C\u093E \u0938\u0915\u0924\u093E \u0939\u0948</1> \u091A\u093E\u0932\u0942 \u0915\u0930\u094B)",
