    "closeQuickTranslation.confirm": "\u091C\u093C\u0930\u0942\u0930",
    "floatBall.popup": "\u0924\u094D\u0935\u0930\u093F\u0924 \u0938\u0947\u091F\u093F\u0902\u0917 \u092A\u0948\u0928\u0932 \u0916\u094B\u0932\u0947\u0902",
    "floatBall.translate": "\u0907\u0938 \u092A\u0943\u0937\u094D\u0920 \u0915\u093E \u0905\u0928\u0941\u0935\u093E\u0926 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F \u0915\u094D\u0932\u093F\u0915 \u0915\u0930\u0947\u0902",
    "floatBall.showOriginal": "\u092E\u0942\u0932 \u092A\u093E\u0920 \u092A\u0930 \u0935\u093E\u092A\u0938 \u091C\u093E\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F \u0915\u094D\u0932\u093F\u0915 \u0915\u0930\u0947\u0902",
    "floatBall.close": "\u0924\u0948\u0930\u0924\u0940 \u0939\u0941\u0908 \u0917\u0947\u0902\u0926 \u0915\u094B \u092C\u0902\u0926 \u0915\u0930\u0947\u0902",
    "floatBallOptions.enableDescPc": "\u092A\u0947\u091C \u092B\u093C\u094D\u0932\u094B\u091F\u093F\u0902\u0917 \u092C\u0949\u0932 \u0938\u0915\u094D\u0937\u092E \u0939\u094B\u0928\u0947 \u0915\u0947 \u092C\u093E\u0926, \u092A\u0943\u0937\u094D\u0920 \u0915\u0947 \u0926\u093E\u0908\u0902 \u0913\u0930 \u090F\u0915 \u0924\u094D\u0935\u0930\u093F\u0924 \u0905\u0928\u0941\u0935\u093E\u0926 \u092C\u091F\u0928 \u092A\u094D\u0930\u0926\u0930\u094D\u0936\u093F\u0924 \u0939\u094B\u0917\u093E\u0964 \u0905\u0928\u0941\u0935\u093E\u0926 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F \u0915\u094D\u0932\u093F\u0915 \u0915\u0930\u0947\u0902\u0964",
    "floatBallOptions.enableDesc": "\u092B\u094D\u0932\u094B\u091F\u093F\u0902\u0917 \u092C\u0949\u0932 \u0915\u094B \u092C\u0902\u0926 \u0915\u0930\u0928\u0947 \u0915\u0947 \u092C\u093E\u0926 \u0907\u0938\u0947{touch}\u0938\u0947 \u091C\u0917\u093E\u092F\u093E \u091C\u093E \u0938\u0915\u0924\u093E \u0939\u0948\u0964 \u0907\u0938 \u0935\u093F\u0915\u0932\u094D\u092A \u0915\u094B \u0917\u0932\u0924\u0940 \u0938\u0947 \u092C\u0902\u0926 \u0915\u0930\u0928\u0947 \u0915\u0947 \u092C\u093E\u0926 \u092B\u094D\u0932\u094B\u091F\u093F\u0902\u0917 \u092C\u0949\u0932 \u0915\u094B \u092E\u093F\u0932\u0928\u0947 \u0938\u0947 \u0930\u094B\u0915\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F, \u0907\u0938 \u0938\u0947\u091F\u093F\u0902\u0917 \u092A\u0947\u091C \u0915\u094B \u092C\u0941\u0915\u092E\u093E\u0930\u094D\u0915 \u0915\u0930\u0928\u0947 \u0915\u0940 \u092A\u0941\u0930\u091C\u094B\u0930 \u0905\u0928\u0941\u0936\u0902\u0938\u093E \u0915\u0940 \u091C\u093E\u0924\u0940 \u0939\u0948\u0964",
    "description.azureApiUrl": "\u0915\u0938\u094D\u091F\u092E \u090F\u092A\u0940\u0906\u0908 \u0907\u0902\u091F\u0930\u092B\u093C\u0947\u0938 \u092A\u0924\u093E \u092D\u0930\u0947\u0902",
    confirmSupportMouse: "\u092E\u093E\u0909\u0938 \u0938\u092E\u0930\u094D\u0925\u0928 \u0915\u094B \u0938\u0915\u094D\u0937\u092E \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F \u092C\u093E\u0927\u094D\u092F \u0915\u0930\u0947\u0902",
    confirmSupportMouseDescription: "\u092F\u0939 \u092A\u093E\u092F\u093E \u0917\u092F\u093E \u0939\u0948 \u0915\u093F \u0935\u0930\u094D\u0924\u092E\u093E\u0928 \u092C\u094D\u0930\u093E\u0909\u091C\u093C\u0930 \u092E\u093E\u0909\u0938 \u092B\u093C\u0902\u0915\u094D\u0936\u0928 \u0915\u093E \u0938\u092E\u0930\u094D\u0925\u0928 \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u093E \u0939\u0948\u0964 \u0915\u094D\u092F\u093E \u0906\u092A \u092E\u093E\u0909\u0938 \u0938\u092E\u0930\u094D\u0925\u0928 \u0915\u094B \u092C\u0932\u092A\u0942\u0930\u094D\u0935\u0915 \u0938\u0915\u094D\u0937\u092E \u0915\u0930\u0928\u093E \u091A\u093E\u0939\u0924\u0947 \u0939\u0948\u0902?",
    sampleTargetText: "\u0932\u092E\u094D\u092C\u0940 \u0930\u093E\u0924 \u0906\u0928\u0947 \u0935\u093E\u0932\u0940 \u0939\u0948, \u0914\u0930 \u0905\u092C \u0938\u0947 \u092E\u0948\u0902 \u092E\u0930\u0928\u0947 \u0924\u0915 \u091C\u093E\u0917\u0924\u093E \u0930\u0939\u0942\u0901\u0917\u093E\u0964 \u092E\u0948\u0902 \u0928 \u092A\u0924\u094D\u0928\u0940 \u0932\u0942\u0901\u0917\u093E, \u0928 \u091C\u093E\u0917\u0940\u0930, \u0928 \u092C\u091A\u094D\u091A\u0947\u0964 \u092E\u0948\u0902 \u0915\u094B\u0908 \u0924\u093E\u091C \u0928\u0939\u0940\u0902 \u092A\u0939\u0928\u0942\u0902\u0917\u093E \u092F\u093E \u0938\u092E\u094D\u092E\u093E\u0928 \u0915\u0947 \u0932\u093F\u090F \u092A\u094D\u0930\u0924\u093F\u0938\u094D\u092A\u0930\u094D\u0927\u093E \u0928\u0939\u0940\u0902 \u0915\u0930\u0942\u0902\u0917\u093E\u0964 \u092E\u0948\u0902 \u0905\u092A\u0928\u093E \u0915\u0930\u094D\u0924\u0935\u094D\u092F \u0928\u093F\u0937\u094D\u0920\u093E\u092A\u0942\u0930\u094D\u0935\u0915 \u0928\u093F\u092D\u093E\u090A\u0902\u0917\u093E, \u091C\u093F\u090A\u0902\u0917\u093E \u0914\u0930 \u092E\u0930\u0942\u0902\u0917\u093E\u0964",
    sampleSourceText: "Night gathers, and now my watch begins. It shall not end until my death. I shall take no wife, hold no lands, father no children. I shall wear no crowns and win no glory. I shall live and die at my post.",
