    "desc.touchShortcutsToggleTranslatePageOnlyTranslation": "\u0915\u0947\u0935\u0932 \u0905\u0928\u0941\u0935\u093E\u0926 \u0915\u093E \u0924\u093E\u0924\u094D\u092A\u0930\u094D\u092F \u0939\u0948 \u0915\u093F \u0915\u0947\u0935\u0932 \u0905\u0928\u0941\u0935\u093E\u0926 \u092A\u094D\u0930\u0926\u0930\u094D\u0936\u093F\u0924 \u0939\u094B\u0917\u093E, \u092F\u0926\u093F \u0935\u0947\u092C\u092A\u0947\u091C \u0905\u092D\u0940 \u0924\u0915 \u0905\u0928\u0941\u0935\u093E\u0926\u093F\u0924 \u0928\u0939\u0940\u0902 \u0939\u0941\u0906 \u0939\u0948, \u0924\u094B \u092E\u094B\u0921 \u092C\u0926\u0932\u0947\u0917\u093E \u0914\u0930 \u0905\u0928\u0941\u0935\u093E\u0926 \u0915\u0930\u0947\u0917\u093E\u0964",
