    "error.proTokenInvalid": "\u092F\u0926\u093F \u0906\u092A \u092A\u094D\u0930\u094B \u0909\u092A\u092F\u094B\u0917\u0915\u0930\u094D\u0924\u093E \u0939\u0948\u0902, \u0924\u094B \u0915\u0943\u092A\u092F\u093E \u092A\u094D\u0930\u094B \u0905\u0928\u0941\u0935\u093E\u0926 \u0938\u0947\u0935\u093E \u0915\u093E \u0909\u092A\u092F\u094B\u0917 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093F\u090F \u0932\u0949\u0917 \u0907\u0928 \u0915\u0930\u0947\u0902\u0964",
    "error.400": "\u0938\u0947\u0935\u093E \u0924\u094D\u0930\u0941\u091F\u093F \u0935\u093E\u092A\u0938 \u0915\u0930\u0924\u0940 \u0939\u0948, \u0905\u0928\u0941\u0930\u094B\u0927 \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u0917\u0932\u0924 \u0939\u0948, \u0915\u0943\u092A\u092F\u093E \u0938\u0902\u092C\u0902\u0927\u093F\u0924 \u0915\u0949\u0928\u094D\u092B\u093C\u093F\u0917\u0930\u0947\u0936\u0928 \u0915\u0940 \u091C\u093E\u0902\u091A \u0915\u0930\u0947\u0902\u0964",
