    "error.claude.403": "\u0938\u0947\u0935\u093E \u0924\u0915 \u092A\u0939\u0941\u0902\u091A \u0915\u093E \u0915\u094B\u0908 \u0905\u0927\u093F\u0915\u093E\u0930 \u0928\u0939\u0940\u0902 \u0939\u0948, \u092F\u0939 Claude \u0915\u0940 \u0915\u094D\u0937\u0947\u0924\u094D\u0930\u0940\u092F \u0938\u0940\u092E\u093E\u0913\u0902 \u0938\u0947 \u0938\u0902\u092C\u0902\u0927\u093F\u0924 \u0939\u094B \u0938\u0915\u0924\u093E \u0939\u0948, \u0906\u092A \u0905\u092A\u0928\u093E IP \u092A\u0924\u093E \u092C\u0926\u0932\u0928\u0947 \u0915\u093E \u092A\u094D\u0930\u092F\u093E\u0938 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902, \u092F\u093E \u0905\u0928\u094D\u092F \u0905\u0928\u0941\u0935\u093E\u0926 \u0938\u0947\u0935\u093E\u0913\u0902 \u0915\u093E \u0909\u092A\u092F\u094B\u0917 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964",
    "browser.brandDescriptionForSafari": "\u3010\u0907\u092E\u0930\u094D\u0938\u093F\u0935 \u0905\u0928\u0941\u0935\u093E\u0926\u3011 \u090F\u0915 \u092E\u0941\u092B\u094D\u0924 (\u092E\u0942\u0932 / \u0905\u0928\u0941\u0935\u093E\u0926) \u0926\u094D\u0935\u093F\u092D\u093E\u0937\u0940 \u0935\u0947\u092C\u092A\u0947\u091C \u0905\u0928\u0941\u0935\u093E\u0926 \u092A\u094D\u0932\u0917\u0907\u0928, \u091C\u094B \u0938\u092E\u092F-\u0938\u092E\u092F \u092A\u0930 PDF \u0905\u0928\u0941\u0935\u093E\u0926 \u0914\u0930 EPUB \u0908-\u092C\u0941\u0915 \u0905\u0928\u0941\u0935\u093E\u0926 \u0915\u093E \u0938\u092E\u0930\u094D\u0925\u0928 \u0915\u0930\u0924\u093E \u0939\u0948 \u0914\u0930 \u092E\u0942\u0932 \u0926\u0938\u094D\u0924\u093E\u0935\u0947\u091C\u093C \u0915\u0940 \u0935\u093F\u0928\u094D\u092F\u093E\u0938 \u0915\u094B \u092C\u0928\u093E\u090F \u0930\u0916\u0924\u093E \u0939\u0948, Youtube/Netflix \u0906\u0926\u093F \u0911\u0928\u0932\u093E\u0907\u0928 \u0935\u0940\u0921\u093F\u092F\u094B \u0926\u094D\u0935\u093F\u092D\u093E\u0937\u0940 \u0909\u092A\u0936\u0940\u0930\u094D\u0937\u0915 \u0905\u0928\u0941\u0935\u093E\u0926, Deepl/Google \u0906\u0926\u093F \u092A\u094D\u0930\u092E\u0941\u0916 \u0905\u0928\u0941\u0935\u093E\u0926 \u0938\u0947\u0935\u093E\u0913\u0902 \u0915\u093E \u0938\u092E\u0930\u094D\u0925\u0928 \u0915\u0930\u0924\u093E \u0939\u0948;",
